package com.adopt.altitude.automation.frontend.data.solverRequest;

public class SolverRequest {

  private String requestName;
  private String solverTask;
  private String crewGroup;
  private String rules;
  private String recipe;

  public String getRequestName() { return requestName; }

  public void setRequestName(String rules) {
    this.requestName = requestName;
  }

  public String getSolverTask() { return solverTask; }

  public void setSolverTask(String solverTask) {
    this.solverTask = solverTask;
  }

  public String getCrewGroup() { return crewGroup; }

  public void setCrewGroup(String crewGroup) {
    this.crewGroup = crewGroup;
  }

  public String getRules() {
    return rules;
  }

  public void setRules(String rules) {
    this.rules = rules;
  }

  public String getRecipe() { return recipe; }

  public void setRecipe(String recipe) {
    this.recipe = recipe;
  }

  public String leftPanelIcon="Solver-Creating-icon";

  public String editDescriptionText="Solver description";

  public String timestampText="Last Modified: ";

  public String descriptionText = "";
}
